import React from 'react'

import './Nav.css'
import Video from './Video'

import './AdminVideo.css'

export const AdminVideo = ({state}) => {

    //valeur des tag 1=>nature 2=>musique  3=>dessin

    const trieParNom=(tabItems)=>{
      
        const search=state.search

        if(search!=''){
            for(let i=0;i<search.lenght;i++){
                if(search[i]!=tabItems[i] && search[i]!=tabItems[i]){
                    return null
                }
            }
        }
       
    } 

    const allVideo=Object.keys(state.video)
                .map(items =>
                    <Video key={items} 
                           name={state.video[items].nom}
                           url={state.video[items].url}
                           tag={state.video[items].tag}
                    />
                )
    console.log(allVideo)
   
    return (
        <div className='cards'>
           {trieParNom(allVideo)}
        </div>
    )
}


export default AdminVideo
